import "./App.css";
import { useState } from "react";

function App() {

  const curtime = new Date().toLocaleTimeString();

  const [time, setCount] = useState( curtime );

  function inc() {
    let cur = new Date().toLocaleTimeString(); 
    setCount( cur );
  }
  return (
    <div className="App">


      <h1>{ time }</h1>
      <button onClick={inc}>update</button>


    </div>
  );
}

export default App;
